INSERT INTO `w2uV3t_posts` VALUES (1,1,'2024-03-09 19:19:03','2024-03-09 19:19:03','<!-- wp:paragraph -->\n<p><img height=\"16\" width=\"16\" alt=\"🌿\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1e/1/16/1f33f.png\"><img height=\"16\" width=\"16\" alt=\"🌟\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png\"> Chào mừng đến với GreenFiber - Nguồn Cảm Hứng Từ Thiên Nhiên! <img height=\"16\" width=\"16\" alt=\"🌟\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png\"><img height=\"16\" width=\"16\" alt=\"🌿\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1e/1/16/1f33f.png\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Bạn đã bao giờ tự hỏi làm thế nào chúng ta có thể biến những thân cây chuối bỏ phí thành những sản phẩm đẹp mắt và thân thiện với môi trường chưa? Hãy cùng GreenFiber khám phá sự sáng tạo từ thiên nhiên nhé!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><img height=\"16\" width=\"16\" alt=\"🌱\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t69/1/16/1f331.png\"> Thân Cây Chuối Tái Chế: Tại GreenFiber, chúng tôi đã tạo ra một dự án thú vị để chuyển đổi những thân cây chuối không sử dụng thành các sản phẩm đa dạng và độc đáo. Từ các sản phẩm thông dụng đến <a></a>trang trí nội thất , mỗi sản phẩm đều mang đến không gian sống của bạn một làn gió mới và sự gần gũi với thiên nhiên.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><img height=\"16\" width=\"16\" alt=\"🌿\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1e/1/16/1f33f.png\"> Vẻ Đẹp Tự Nhiên Trong Mỗi Sản Phẩm : Những sản phẩm của chúng tôi được làm từ sợi cây chuối tự nhiên, mang lại sự ấm áp và gần gũi cho không gian của bạn. Từ những chiếc đèn trang trí cho đến nội thất độc đáo, mỗi sản phẩm đều là một biểu tượng của sự độc đáo và tinh tế.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><img height=\"16\" width=\"16\" alt=\"🍃\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta/1/16/1f343.png\"> Hãy Tham Gia Cùng Chúng Tui !!! : Đến với GreenFiber, bạn không chỉ là khách hàng mà còn là một phần của cộng đồng chăm sóc môi trường. Mỗi sản phẩm bạn mua đều là một bước tiến trong hành trình bảo vệ hành tinh của chúng ta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><img height=\"16\" width=\"16\" alt=\"🌟\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png\"> Khám Phá Sản Phẩm GreenFiber Ngay Hôm Nay!: Hãy ghé thăm trang web của chúng tôi để khám phá sự đa dạng và sự sáng tạo của GreenFiber!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><img height=\"16\" width=\"16\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t1e/1/16/1f33f.png\" alt=\"🌿\"><img height=\"16\" width=\"16\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png\" alt=\"🌟\"> Hãy cùng chung tay bảo vệ hành tinh và tạo ra một tương lai xanh sạch hơn cùng GreenFiber nhé! <img height=\"16\" width=\"16\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/te0/1/16/1f31f.png\" alt=\"🌟\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":51,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://naturehandmade.xyz/wp-content/uploads/2024/03/Banner-GreenFiber-1-1024x512.png\" alt=\"\" class=\"wp-image-51\"/></figure>\n<!-- /wp:image -->','Nature Handmade (GreenFiber)','','publish','open','closed','','hello-world','','','2024-03-11 23:01:24','2024-03-11 16:01:24','',0,'https://naturehandmade.xyz/?p=1',0,'post','',1),(2,1,'2024-03-09 19:19:03','2024-03-09 19:19:03','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://naturehandmade.xyz/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','publish','closed','closed','','sample-page','','','2024-03-09 19:19:03','2024-03-09 19:19:03','',0,'https://naturehandmade.xyz/?page_id=2',0,'page','',0),(3,1,'2024-03-09 19:19:03','2024-03-09 19:19:03','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: https://naturehandmade.xyz.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','closed','','privacy-policy','','','2024-03-09 19:19:03','2024-03-09 19:19:03','',0,'https://naturehandmade.xyz/?page_id=3',0,'page','',0),(4,0,'2024-03-09 19:19:03','2024-03-09 19:19:03','<!-- wp:page-list /-->','Navigation','','publish','closed','closed','','navigation','','','2024-03-09 19:19:03','2024-03-09 19:19:03','',0,'https://naturehandmade.xyz/index.php/2024/03/09/navigation/',0,'wp_navigation','',0),(6,1,'2024-03-10 23:14:57','2024-03-10 23:14:57','','woocommerce-placeholder','','inherit','open','closed','','woocommerce-placeholder','','','2024-03-10 23:14:57','2024-03-10 23:14:57','',0,'https://naturehandmade.xyz/wp-content/uploads/2024/03/woocommerce-placeholder.png',0,'attachment','image/png',0),(7,1,'2024-03-10 23:14:59','2024-03-10 23:14:59','','Shop','','publish','closed','closed','','shop','','','2024-03-10 23:14:59','2024-03-10 23:14:59','',0,'https://naturehandmade.xyz/index.php/shop/',0,'page','',0),(8,1,'2024-03-10 23:14:59','2024-03-10 23:14:59','<!-- wp:woocommerce/cart -->\n<div class=\"wp-block-woocommerce-cart alignwide is-loading\"><!-- wp:woocommerce/filled-cart-block -->\n<div class=\"wp-block-woocommerce-filled-cart-block\"><!-- wp:woocommerce/cart-items-block -->\n<div class=\"wp-block-woocommerce-cart-items-block\"><!-- wp:woocommerce/cart-line-items-block -->\n<div class=\"wp-block-woocommerce-cart-line-items-block\"></div>\n<!-- /wp:woocommerce/cart-line-items-block -->\n\n<!-- wp:woocommerce/cart-cross-sells-block -->\n<div class=\"wp-block-woocommerce-cart-cross-sells-block\"><!-- wp:heading {\"fontSize\":\"large\"} --